// 5-building.js

class Building {
    constructor(sqft) {
        if (new.target === Building) {
            throw new Error("Cannot instantiate abstract class Building directly.");
        }
        this._sqft = sqft;
        this.checkEvacuationWarningMessage();
    }

    get sqft() {
        return this._sqft;
    }

    // Ensure that subclasses must implement this method
    evacuationWarningMessage() {
        throw new Error("Class extending Building must override evacuationWarningMessage");
    }

    // Method to enforce that evacuationWarningMessage is called
    checkEvacuationWarningMessage() {
        this.evacuationWarningMessage();
    }
}

export default Building;
